class ProjectDetails extends React.Component {
  render() {
    return (
      <Card style={{width: '25rem'}}>
          <Card.Img style={{width: '25rem', height: '8rem'}}src="/images/solid-card-image.png" alt="Card image"/>
                <div style={{alignContent: 'center', width: '80%'}}>
                <Card.ImgOverlay style={{textAlign: 'center', alignContent: 'center', width: '80%',position: 'absolute'}}>
                    <Card.Title>Project Name Here</Card.Title>
                </Card.ImgOverlay>
                </div>

          <Card.Body>
              <Card.Text>
                  <b>Project\n</b>
                  Project Description
              </Card.Text>
          </Card.Body>
      </Card>


    )
  }
}

export default ProjectDetails;
